import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { HomeComponent } from './home/home.component';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';

import { RouterModule, Routes } from '@angular/router';
import { HeaderComponent } from './header/header.component';
import { AddNoteComponent } from './add-note/add-note.component';
import { NotesListComponent } from './notes-list/notes-list.component';
import { FormComponent } from './form/form.component';
import routeConfig from './routes';
import { NoteDetailComponent } from './note-detail/note-detail.component';
import { WelcomeImageComponent } from './welcome-image/welcome-image.component';
import { SingInComponent } from './sing-in/sing-in.component';
import { SingInFormComponent } from './sing-in-form/sing-in-form.component';
import { SingUpFormComponent } from './sing-up-form/sing-up-form.component';
import { SingUpComponent } from './sing-up/sing-up.component';
import { OtherComponent } from './other/other.component';
// import { SingInComponent } from './sing-in/sing-in.component';

import { AdminModule } from './admin/admin.module';
import { LoginComponent } from './auth/login/login.component';
import { AuthModule } 


@NgModule({
  declarations: [
    AppComponent,
    HomeComponent,
    HeaderComponent,
    NotesListComponent,
    FormComponent,
    AddNoteComponent,
    NoteDetailComponent,
    WelcomeImageComponent,
    SingInFormComponent,
    SingUpFormComponent,
    SingUpComponent,
    OtherComponent,
    SingInComponent,
    LoginComponent,
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    FormsModule,
    ReactiveFormsModule,
    RouterModule.forRoot(routeConfig),
    AdminModule,
  ],
  providers: [],
  bootstrap: [AppComponent],
  exports: [RouterModule]
})
export class AppModule { }
